		//-----------------------
		//  邨ｵ繧貞虚縺九☆
		//-----------------------
		public void Move(){

			yPos+=y_sp*FRAMTIME;
			if (yPos > 540*9) {
				yPos=540*9;
				y_sp=0;
			}

		}//Move End


		//-----------------------
		//繧ｰ繝ｩ繝輔ぅ繝�繧ｯ陦ｨ遉ｺ
		//-----------------------
		public void Draw(JFrame Wind,Graphics2D g){

			for(int i=0; i<10; i++){
				g.drawImage(MAP[i],0,i*-540+(int)yPos,Wind);
			}

			//譁�蟄励�ｮ陦ｨ遉ｺ
			g.setColor(Color.YELLOW);//濶ｲ謖�螳�
			g.setFont(f);
			for(int j=0; j<340; j++){
				for(int i=0; i<60; i++){
					int d = Hit_D[j][i];
					if (d==1) g.drawString("H",16*i,16*j+16-4860+(int)yPos);
				}
			}
		}

